import React from 'react';
import styled from 'styled-components';
import '../../App.css';

import {
  Switch,
  Route,
  Link,
} from 'react-router-dom';

const LogoS = styled.div`
  display: flex;
  font-family: 'bitbit';
  vertical-align: bottom;
  align-items:center;
  width : ${(props) => props.width};
  height: 36px;
  cursor: pointer;
  margin-left: ${(props) => props.marginleft};
  text-align: center;
  font-weight: ${(props) => props.fontweight};
  font-size: 32px;
  color: ${(props) => props.color};
`;

const StyledLink = styled(Link)`
  display: flex;
  font-family: 'bitbit';
  vertical-align: bottom;
  align-items:center;
  width : ${(props) => props.width};
  height: 36px;
  cursor: pointer;
  margin-left: 10px;
  text-align: center;
  font-weight: 100;
  font-size: 32px;
`;

function Logo() {

  return <>
    <LogoS marginleft='10px' color='rgb(0,0,72)'>D</LogoS>
    <LogoS color='rgb(0,0,100)' fontweight='1'>igital</LogoS>
    <LogoS marginleft='10px' color='rgb(0,0,72)'>S</LogoS>
    <LogoS color='rgb(0,0,100)' fontweight='1'>tore</LogoS>
  </>;
}

export default Logo;
